  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of digital water-table
  contours for the Mojave River Basin. The U.S. Geological Survey, in cooperation
  with the Mojave Water Agency, constructed a water-table map of the Mojave River
  ground-water basin for ground-water levels measured in November 1992. Water-level
  data were collected from approximately 300 wells to construct the contours. The
  water-table contours were digitized from the paper map which was published at a
  scale of 1:125,000. The contour interval ranges from 3,200 to 1,600 feet above sea
  level.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
